    alphabet = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z']
    alphabetnums = {chr(i + 96): str(i) for i in range(-1, 27)}

    def transform(match):
        group = match.group()
        if group.isalpha():
            return alphabetnums[group]
        else:
            return alphabet[int(group) - 1]
    return re.sub('[0-9]{1,2}|[a-z]', transform, string)

